import '../allStyles/Signup.css';
import {React, useState} from "react";
import { Link } from 'react-router-dom';


function Signup (){
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");

    const [alldata, setAllData] = useState([]);

    const submitForm = (e) =>{
        e.preventDefault();
        const newEntry = {email : email , password : password};

        setAllData([...alldata,newEntry]);
        console.log(alldata);
    } 

    return (
        <div className='mainContainer'>
            <div className='mainContent'>
                Please SignUp to continue <Link to="/"><i className="fas fa-times"></i></Link>
            </div>
            <div className="upperContainer">  </div>
            <div className='formContainer'>
                <form action="" onSubmit = {submitForm} className="registerForm">
                    <div className='one'>
                        <label className='entryLabel' htmlFor="email">Email</label>
                        <input type="email" name="email" placeholder="yourEmail@email.com" id="email"
                            value={email} onChange = {(e) => setEmail(e.target.value)}
                        />
                    </div>
                    <div className='one'>
                        <label htmlFor="password">Password</label>
                        <input type="password" name="password" placeholder="********" id="password" 
                            value={password} onChange = {(e) => setPassword(e.target.value)}
                        />
                    </div>
                    <button className = "registerButton"type="submit">SignUp</button>
                </form>
            </div>
        </div>
    );
}

export default Signup;
